import React, { useState, useEffect } from "react";
import { ChevronDown, Menu, X, Sun, Moon } from "lucide-react";
import "../styles/Navbar.css"
import b_1 from "../b_1.png"
const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [isAcademicsOpen, setIsAcademicsOpen] = useState(false);
  const [scrolled, setScrolled] = useState(false);
  const [isDarkTheme, setIsDarkTheme] = useState(true);
  const [closeTimeout, setCloseTimeout] = useState(null);

  useEffect(() => {
    const handleScroll = () => {
      setScrolled(window.scrollY > 50);
    };
    window.addEventListener("scroll", handleScroll);
    return () => window.removeEventListener("scroll", handleScroll);
  }, []);

  const toggleTheme = () => {
    setIsDarkTheme(!isDarkTheme);
  };

  const handleMouseEnter = () => {
    if (closeTimeout) {
      clearTimeout(closeTimeout);
      setCloseTimeout(null);
    }
    setIsAcademicsOpen(true);
  };

  const handleMouseLeave = () => {
    const timeout = setTimeout(() => {
      setIsAcademicsOpen(false);
    }, 300);
    setCloseTimeout(timeout);
  };

  return (
    <>
      <nav
        className={`navbar ${isDarkTheme ? "dark-theme" : "light-theme"} ${
          scrolled ? "scrolled" : ""
        }`}
      >
        <div className="navbar-container">
          <div className="navbar-content">
            <a href="#home" className="navbar-logo">
              <img src={b_1} className="logo" alt="logo" />
              <div className="logoname">
                <p className="first">MLS & </p>
                <p className="last">LAW FIRM</p>
              </div>
            </a>

            <div className="navbar-menu">
              <a href="#about">About Us</a>
              <a href="#practice">Practice Areas</a>
              <a href="#people">Our People</a>
              <a href="#careers">Careers</a>
              
              <div
                className="navbar-dropdown"
                onMouseEnter={handleMouseEnter}
                onMouseLeave={handleMouseLeave}
              >
                <button className="navbar-dropdown-btn">
                  Academics <ChevronDown size={16} />
                </button>
                {isAcademicsOpen && (
                  <div 
                    className="navbar-dropdown-menu"
                    onMouseEnter={handleMouseEnter}
                    onMouseLeave={handleMouseLeave}
                  >
                    <a href="#blogs">Blogs</a>
                    <a href="#newsletters">Newsletters</a>
                    <a href="#publications">Publications</a>
                    <a href="#events">Events</a>
                  </div>
                )}
              </div>
              
              <a href="#contact">Contact Us</a>
            </div>

            <div className="navbar-actions">
              <button onClick={toggleTheme} className="navbar-theme-btn" aria-label="Toggle theme">
                {isDarkTheme ? <Sun size={20} /> : <Moon size={20} />}
              </button>
              <button
                onClick={() => setIsOpen(!isOpen)}
                className="navbar-mobile-toggle"
                aria-label="Toggle menu"
              >
                {isOpen ? <X size={24} /> : <Menu size={24} />}
              </button>
            </div>
          </div>

          {isOpen && (
            <div className="navbar-mobile-menu">
              <a href="#about" onClick={() => setIsOpen(false)}>
                About Us
              </a>
              <a href="#practice" onClick={() => setIsOpen(false)}>
                Practice Areas
              </a>
              <a href="#people" onClick={() => setIsOpen(false)}>
                Our People
              </a>
              <a href="#careers" onClick={() => setIsOpen(false)}>
                Careers
              </a>
              
              <details className="mobile-dropdown">
                <summary>Academics</summary>
                <div className="mobile-dropdown-menu">
                  <a href="#blogs" onClick={() => setIsOpen(false)}>
                    Blogs
                  </a>
                  <a href="#newsletters" onClick={() => setIsOpen(false)}>
                    Newsletters
                  </a>
                  <a href="#publications" onClick={() => setIsOpen(false)}>
                    Publications
                  </a>
                  <a href="#events" onClick={() => setIsOpen(false)}>
                    Events
                  </a>
                </div>
              </details>
              
              <a href="#contact" onClick={() => setIsOpen(false)}>
                Contact Us
              </a>
            </div>
          )}
        </div>
      </nav>
    </>
  );
};

export default Navbar;
